INSERT INTO `indicateur_indicateur` (`id`, `code`, `libelle`, `libelle_ang`, `responsable_collecte`, `description`, `description_ang`, `indicateur_CRA`, `composite`, `formule`, `statut`, `calcule`, `date_created`, `date_updated`, `frequence_id`, `niveau_id`, `sousysteme_id`, `unite_id`) VALUES
(1, '01R001', 'Le bilan alimentaire annuel (en valeur absolue)', 'The annual food balance sheet(in absolute value)', 'Dr Martial TRAORE', 'Selon la FAO, le bilan alimentaire donne une idée d\'ensemble de la composition des approvisionnements d\'un pays durant une période donnée', 'According to FAO, the food balance sheet gives an overall idea of ​​the composition of a country\'s supplies over a given period.', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 11:22:48.496525', '2024-10-13 11:22:48.496525', 3, 1, 12, 9),
(2, '01R002', 'le nombre de zones à risques (ZAR) par an', 'The number of zones  at risks of food (ZAR) per year', 'Dr Martial TRAORE', 'Zones succeptibles d\'être affectées par l\'insécurité alimentaire ', 'Areas likely to be affected by food insecurity', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 11:26:52.481184', '2024-10-13 11:26:52.481184', 3, 1, 12, 9),
(3, '01R003', 'Taux de couverture des besoins alimentaires (en pourcentage des besoins)', 'Food needs coverage rate (needs in percentage) ', 'Dr Martial TRAORE', 'Nombre de mois  sur douze(12) de couverture des besoins alimentaires suivants les normes de consommation par pays', 'Number of months out of twelve (12) of coverage of food needs following consumption standards by country', 'NON', 'NON', '', 'NON', NULL, '2024-10-13 11:29:54.522656', '2024-10-13 11:29:54.522656', 3, 1, 12, 1),
(4, '01R004', 'Adoption de l\'approche bilan alimentaire en matière d\'autosuffisance/ de sécurité alimentaire ', 'Adoption of  Food balance sheet approach in terms of  self sufficiency/food Security', 'Dr Martial TRAORE', 'Nombre de pays ayant adopté l\'approche bilan alimentaire', 'Number of countries that have adopted the food balance sheet approach', 'NON', 'NON', '', 'NON', NULL, '2024-10-13 11:32:18.491615', '2024-10-13 11:32:18.491615', 3, 1, 12, 9),
(5, '01R005', 'Le taux de réduction des gaps entre les prévisions (nombre de personnes vulnérables, de leur localisation, des besoins alimentaires) et la situation réelle', 'The gap reduction rate between the forecasts ( number of vulnerable people, their localization, needs for assistance) and the real situation', 'Dr Martial', 'Taux  de réduction des gaps entre les prévisions (nombre de personnes vulnérables, de leur localisation, des besoins alimentaires) et la situation réelle', 'The gap reduction rate between the forecasts ( number of vulnerable people, their localization, needs for assistance) and the real situation', 'NON', 'NON', '', 'NON', NULL, '2024-10-13 12:52:03.480216', '2024-10-13 12:52:03.480216', 3, 3, 12, 1),
(6, '01R006', 'Le nombre de crises alimentaires sérieuses ou famine', 'The number of  serious food crises or famine', 'Dr Martial', 'Il s\'agit de compter le nombre de crises alimentaires sérieuses ou de famine chaque 5 ans ', 'This involves counting the number of serious food crises or famines every 5 years.', 'NON', 'NON', '', 'NON', NULL, '2024-10-13 12:57:32.763172', '2024-10-13 12:57:32.763172', 3, 3, 12, 9),
(7, '01R007', 'Niveau des pertes par type de culture et par type d\'ennemis', 'Level of losses per  type of crop and crop  pest', 'Dr Idrissa MAIGA', 'Il s\'agit du pourcentage de perte occasionné par des ravageurs / maladies sur la culture infestée', 'This is the percentage of loss caused by pests/diseases on the infested crop.', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 13:00:31.037975', '2024-10-13 13:00:31.037975', 3, 3, 12, 1),
(8, '01R008', 'Pourcentage zones à risques alimentaires (ZAR) par an', ' Food Zone At Risk  Percentage(ZAR) per year', 'Dr Idrissa Maiga', 'Il s\'agit du nombre de localités concernés par les ZAR sur le nombre total de localités du pays ', 'This is the number of localities concerned by the ZARs out of the total number of localities in the country.', 'NON', 'NON', '', 'NON', NULL, '2024-10-13 13:03:43.565384', '2024-10-13 13:03:43.565384', 3, 3, 12, 1),
(9, '01R009', 'Pourcentage de la population affectées dans les zones à risques alimentaires (ZAR) par an', 'Percentage of the population concerned with food Zone At Risk (ZAR) per year', 'Dr Martial TRAORE', 'Il s\'agit de la population  affectées dans les ZAR sur la population totale du  niveau de decoupage 2 ', 'This is the population affected in the ZARs out of the total population of the division level 2', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 13:09:36.378786', '2024-10-13 13:09:36.378786', 3, 3, 12, 1),
(10, '01S001', 'Pourcentage des superficies  infestées par type de cultures et d\'ennemis', 'Percentage of area that are affected per type of crop and crop pests', 'Dr Idrissa MAIGA', 'Il s\'agit du pourcentage de superficies infestées par type de culture et par type d\'ennemis sur le total de superficies emblavées par type de culture', 'This is the percentage of infested areas by crop type and by type of enemies out of the total areas sown by crop type.', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 13:13:25.328723', '2024-10-13 13:13:25.328723', 3, 3, 12, 1),
(11, '01S002', 'Pourcentage des superficies traitées par type de cultures et d\'ennemis', 'Percentage of area treated per type of crops and crop pests ', 'Dr Idrissa MAIGA', 'Il s\'agit du pourcentage de superficies traitées par type de culture et par type d\'ennemis sur le total de superficies infestées par type de culture et par type d\'ennemis', 'This is the percentage of areas treated by crop type and by enemy type out of the total areas infested by crop type and by enemy type.', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 13:16:07.629445', '2024-10-13 13:16:07.629445', 3, 3, 12, 1),
(12, '01S003', 'Niveau des dégâts par type de culture et par type d\'ennemis', 'Level of damage per type of crop and crop pest', 'Dr Idrissa MAIGA', 'Il s\'agit d\'apprécier la sévérité de l\'attaque par ennemi de culture à l\'aide d\'une grille de notation', 'This involves assessing the severity of the attack by a crop enemy using a rating grid.', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 13:21:04.914655', '2024-10-13 13:21:04.914655', 3, 3, 12, 1),
(13, '01S004', 'Pourcentage des superficies affectées par les feux de brousses', 'Percentage of areas affected by bush fires', 'Dr Issa GARBA', 'il s\'agit du rapport des superficies  affectées par les feux de brousse sur la superficie végétale totale exprimée en pourcentage', 'This is the ratio of areas affected by bushfires to the total plant area expressed as a percentage.', 'NON', 'NON', '', 'OUI', NULL, '2024-10-13 13:23:45.691761', '2024-10-13 13:23:45.691761', 3, 1, 12, 1),
(14, '01S005', 'Taux de couverture des besoins céréaliers', 'Cereal needs coverage rate', 'Dr Issa Garba', 'Nombre de mois  sur douze(12) de couverture des besoins céréaliers en rapport avec les normes de consomation par pays', 'Number of months out of twelve (12) of coverage of cereal needs in relation to consumption standards by country', 'NON', 'NON', '', 'NON', NULL, '2024-10-13 13:27:29.795552', '2024-10-13 13:27:29.795552', 3, 1, 12, 1),
